import React from 'react';
import 'bulma/css/bulma.min.css';
import { NavbarItem, NavbarLink, NavbarDropdown } from 'react-bulma-components';


function Navigation() {
    return (
        <NavbarItem href="#">
            <NavbarLink>Item</NavbarLink>
            <NavbarDropdown>
                <Navbar.Item href="#">Subitem 1</Navbar.Item>
                <Navbar.Item href="#">Subitem 2</Navbar.Item>
            </NavbarDropdown>
        </NavbarItem>
    );
}
export default Navigation;
